import React from 'react';

function Features() {
  return (
    <div className="features">
      <h1>Features</h1>
      <ul>
        <li>AI Chatbot for instant responses</li>
        <li>Seamless integration with your website</li>
        <li>Customizable workflows and automations</li>
        <li>Analytics dashboard</li>
        <li>Calendar booking system</li>
      </ul>
    </div>
  );
}

export default Features;
